import axios from "axios";
import React, { useEffect, useState } from "react";
import { Link, useNavigate, useParams } from "react-router-dom";

export default function EditarInstitucion({ onInstitucionEdited }) {
  const urlBase = "http://localhost:8080/sipress-app/instituciones";

  let navigate = useNavigate();

  const { id } = useParams();

  const [institucion, setInstitucion] = useState({
    idInstitucion: "",
    nombreInstitucion: "",
    direccionInstitucion: "",
    telefonoInstitucion: "",
    codigoPostal: "",
  });

  const {
    idInstitucion,
    nombreInstitucion,
    direccionInstitucion,
    telefonoInstitucion,
    codigoPostal,
  } = institucion;

  useEffect(() => {
    cargarInstitucion();
  });

  const cargarInstitucion = async () => {
    const resultado = await axios.get(`${urlBase}/${id}`);
    setInstitucion(resultado.data);
  };

  const onInputChange = (e) => {
    setInstitucion({ ...institucion, [e.target.name]: e.target.value });
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    await axios.put(`${urlBase}/${id}`, institucion);
    navigate("/src/registros/ListadoInstituciones");
  };

  return (
    <section id="details">
      <div class="container">
        <div class="row justify-content-center">
          <div class="col-lg-9">
            <div class="card">
              <div class="card-header">
                <h4>Modificar Registro</h4>
              </div>
              <form onSubmit={(e) => onSubmit(e)}>
                <div className="card-body">
                  <div className="form-floating form-group mb-3">
                    <input
                      type="text"
                      className="form-control"
                      id="idInstitucion"
                      name="idInstitucion"
                      placeholder="ID Institución"
                      required={true}
                      value={idInstitucion}
                      onChange={(e) => onInputChange(e)}
                    />
                    <label htmlFor="idInstitucion">ID de la Institución</label>
                  </div>

                  <div className="form-floating form-group mb-3">
                    <input
                      type="text"
                      className="form-control"
                      id="nombreInstitucion"
                      name="nombreInstitucion"
                      placeholder="Nombre de la Institución"
                      required={true}
                      value={nombreInstitucion}
                      onChange={(e) => onInputChange(e)}
                    />
                    <label htmlFor="nombreInstitucion">
                      Nombre de la Institución
                    </label>
                  </div>

                  <div className="form-floating form-group mb-3">
                    <input
                      type="text"
                      className="form-control"
                      id="direccionInstitucion"
                      name="direccionInstitucion"
                      placeholder="Dirección"
                      required={true}
                      value={direccionInstitucion}
                      onChange={(e) => onInputChange(e)}
                    />
                    <label htmlFor="direccionInstitucion">
                      Dirección de la Institución
                    </label>
                  </div>

                  <div className="form-floating form-group mb-3">
                    <input
                      type="tel"
                      className="form-control"
                      id="telefonoInstitucion"
                      name="telefonoInstitucion"
                      placeholder="Teléfono de la Institución"
                      required={true}
                      value={telefonoInstitucion}
                      onChange={(e) => onInputChange(e)}
                    />
                    <label htmlFor="telefonoInstitucion">
                      Teléfono de la Institución
                    </label>
                  </div>

                  <div className="form-floating form-group mb-3">
                    <input
                      type="text"
                      className="form-control"
                      id="codigoPostal"
                      name="codigoPostal"
                      placeholder="Código Postal"
                      required={true}
                      value={codigoPostal}
                      onChange={(e) => onInputChange(e)}
                    />
                    <label htmlFor="codigoPostal">Código Postal</label>
                  </div>
                </div>
                <div className="modal-footer">
                  <Link
                    to="/src/registros/ListadoInstituciones.js"
                    className="btn btn-info">
                    <i className="fa-solid fa-arrow-left-long"></i> Regresar
                  </Link>
                  <button type="submit" className="btn btn-primary">
                    <i className="fa-solid fa-folder-plus"></i> Guardar cambios
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
